import React from "react";
import Login from '../Components/Login/Index';
import Employee from '../Components/Employee/Index';
const routes = [
    {
        path:"/",
        exact:true,
        main:()=><Login />
    },
    {
        path:"/employee",
        exact:true,
        main:()=><Employee />
    }
];
export default routes;
